import './carousel.css';
// import {Container} from './style'
import Foto from '../../imagens/moto.jpg';


export default function Carousel(){
    
    let nomes = ["José", "Maria", "Pedro"]

    const mostra = nomes.map(n => <li> | {n}</li> ); 
    
    return(
        <>   
        {/*<img src={Foto}></img>*/}
        <ul >{mostra}</ul>

        </>
       
    )

}
